type GOPRO_HEARTBEAT_STATUS = ardupilotmega.GOPRO_HEARTBEAT_STATUS

const (
	// No GoPro connected.
	GOPRO_HEARTBEAT_STATUS_DISCONNECTED GOPRO_HEARTBEAT_STATUS = ardupilotmega.GOPRO_HEARTBEAT_STATUS_DISCONNECTED
	// The detected GoPro is not HeroBus compatible.
	GOPRO_HEARTBEAT_STATUS_INCOMPATIBLE GOPRO_HEARTBEAT_STATUS = ardupilotmega.GOPRO_HEARTBEAT_STATUS_INCOMPATIBLE
	// A HeroBus compatible GoPro is connected.
	GOPRO_HEARTBEAT_STATUS_CONNECTED GOPRO_HEARTBEAT_STATUS = ardupilotmega.GOPRO_HEARTBEAT_STATUS_CONNECTED
	// An unrecoverable error was encountered with the connected GoPro, it may require a power cycle.
	GOPRO_HEARTBEAT_STATUS_ERROR GOPRO_HEARTBEAT_STATUS = ardupilotmega.GOPRO_HEARTBEAT_STATUS_ERROR
)
